const x =[
    "",
    "",
    "",
    "",
    ""
];

const keyPad = [
    [null, null, 1, null, null],
    [null, 2, 3, 4, null],
    [5, 6, 7, 8, 9],
    [null, "A", "B", "C", null],
    [null, null, "D", null, null]
];

let pos = {
    x: 0,
    y: 2
};

let code = [];

for(let i = 0; i<x.length; i++){
    let str = x[i];

    code.push(getButton(str));
}

console.log(code);
function getButton(str){
    for(let i = 0; i<str.length; i++){
        switch (str[i]) {
            case "U":
                if(pos.y > 0 && notNull(0, -1)) pos.y--;
                break;
            case "R":
                if(pos.x < 4 && notNull(1, 0)) pos.x++;
                break;
            case "D":
                if(pos.y < 4 && notNull(0, 1)) pos.y++;
                break;
            case "L":
                if(pos.x > 0 && notNull(-1, 0)) pos.x--;
                break;
            default:

        }
    }

    return keyPad[pos.y][pos.x];
}

function notNull(x, y){
    if(keyPad[pos.y + y][pos.x + x] == null){
        return false;
    }
    return true;
}
